    <style>
       
        :root {
            --bg-main: #0f172a; --panel-bg: rgba(30, 41, 59, 0.85);
            --signal-blue: #38bdf8; --text-core: #f1f5f9; --text-dim: #94a3b8;
            --grid-line: 1px solid rgba(148, 163, 184, 0.15);
        }
        body { font-family: 'Inter', sans-serif; background-color: var(--bg-main); color: var(--text-core); margin: 0; min-height: 100vh; }
        .atomic-lattice { position: fixed; top: 0; left: 0; width: 100%; height: 100%; background-image: linear-gradient(rgba(255,255,255,0.02) 1px, transparent 1px), linear-gradient(90deg, rgba(255,255,255,0.02) 1px, transparent 1px); background-size: 60px 60px; z-index: -1; pointer-events: none; }
        .control-panel-header { background: rgba(15, 23, 42, 0.95); border-bottom: var(--grid-line); position: sticky; top: 0; z-index: 50; padding: 1rem 0; backdrop-filter: blur(10px); }
        .interface-width { width: 92%; max-width: 1400px; margin: 0 auto; display: flex; justify-content: space-between; align-items: center; }
        .system-id { font-family: 'JetBrains Mono', monospace; font-size: 1.3rem; font-weight: 700; color: var(--text-core); display: flex; align-items: center; gap: 8px; }
        .system-id span { color: var(--signal-blue); }
        .data-input { width: 250px; padding: 10px 15px; background: rgba(15, 23, 42, 0.5); border: 1px solid rgba(56, 189, 248, 0.2); border-radius: 4px; color: var(--text-core); font-family: 'JetBrains Mono', monospace; transition: 0.3s; }
        .data-input:focus { outline: none; border-color: var(--signal-blue); }
        .workspace-grid { display: flex; width: 92%; max-width: 1400px; margin: 30px auto; gap: 30px; }
        .data-stream-col { flex: 1; }
        .auxiliary-col { width: 320px; flex-shrink: 0; }
        .analysis-grid { display: grid; grid-template-columns: repeat(auto-fill, minmax(110px, 1fr)); gap: 15px; margin-top: 20px; }
        .compound-unit { background: rgba(30, 41, 59, 0.5); border: 1px solid rgba(148, 163, 184, 0.1); border-radius: 6px; padding: 12px; text-align: center; cursor: pointer; transition: all 0.3s; opacity: 0; animation: fadeUp 0.5s forwards; }
        .compound-unit:hover { background: rgba(56, 189, 248, 0.1); border-color: var(--signal-blue); transform: translateY(-3px); }
        .compound-unit img { width: 55px; height: 55px; border-radius: 8px; object-fit: cover; filter: grayscale(100%); transition: 0.3s; }
        .compound-unit:hover img { filter: none; }
        .compound-label { font-size: 0.7rem; color: var(--text-dim); font-weight: 600; height: 2.4em; overflow: hidden; display: -webkit-box; -webkit-line-clamp: 2; -webkit-box-orient: vertical; margin-top: 5px; }
        .compound-unit:hover .compound-label { color: var(--text-core); }
        .ref-tag { display: block; text-align: center; font-size: 0.6rem; color: #64748b; margin-bottom: 5px; text-transform: uppercase; letter-spacing: 1px; }
        .primary-ad { width: 970px; height: 250px; background: #e2e8f0; margin: 0 auto 30px auto; display: flex; justify-content: center; align-items: center; color: #64748b; border: 1px dashed #94a3b8; max-width: 100%; overflow: hidden; }
        .side-ad { width: 300px; height: 250px; background: #e2e8f0; margin: 0 auto 20px auto; display: flex; justify-content: center; align-items: center; color: #64748b; border: 1px dashed #94a3b8; }
        @keyframes fadeUp { to { opacity: 1; transform: translateY(0); } }
        @media (max-width: 900px) { .workspace-grid { flex-direction: column; } .auxiliary-col { width: 100%; } .primary-ad { height: auto; min-height: 100px; } }
    </style>
</head>
